// src/components/MainMenu.js
import React from 'react';
import { Link } from 'react-router-dom';
import styles from '../styles/MenuBar.mudule.scss';

const MainMenu = () => {
  return (
    <div className={styles.menuBar}> 
      <ul>
        <li><Link to="/industries">Industries</Link></li>
        <li><Link to="/products">Products</Link></li>
        <li><Link to="/sustainability">Sustainability</Link></li>
        <li><Link to="/formulations">Formulations</Link></li>
        <li><Link to="/cosmeticIngredients">Cosmetic Ingredients</Link></li>
        <li><Link to="/foodIngredients">Food Ingredients</Link></li>
        <li><Link to="/caseIngredients">CASE Ingredients</Link></li>
        <li><Link to="/plastics">Plastics</Link></li>
        <li><Link to="/pharmaceuticals">Pharmaceuticals & Nutraceuticals</Link></li>
      </ul>
    </div>
  );
}

export default MainMenu;
